import { Checkboxland } from '../../../src/index.js';

const width = 44;
const height = 32;
const dimensions = `${width}x${height}`;

let cbl;

function init(existingCbl) {
  cbl = !!existingCbl ? existingCbl : new Checkboxland({ dimensions });

  // This video was converted to a data-url below for convenience in displaying
  // the animation both on the docs page and in the standalone demo. Before
  // converting it to a data-url, I scaled the video down to 44x32 (the checkbox
  // resolution) to save space. For reference see the original video files:
  //
  //   Original source video: https://archive.org/details/TouhouBadApple
  //   Scaled source video: bad-apple.mp4
  //
  cbl.renderVideo(getVideoDataUrl());

  return cbl;
}

function cleanUp() {
  cbl.renderVideo.cleanUp()
}

export {
  init,
  cleanUp,
  dimensions
}


// I'm keeping the video data down here for file readability. //


function getVideoDataUrl() {
  return `data:video/mp4;base64,`;
}
